    <MDBContainer fluid>
      <Navbar />

    </MDBContainer>
  );
}

function About() {
  return (
    <MDBContainer fluid>
      <Navbar />

    </MDBContainer>
  );
}



function App() {
  return (
    <>
        <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/submit-proposal" element={<Submit />} />
        <Route path="/vote" element={<Vote />} />
        <Route path="/about" element={<About />} />
        </Routes>
        </>
  );
}

export default App;
